import { Component } from '@angular/core';
//import { ScrobblerService } from '../scrobbler.service';

import { SingleTrack } from '../single-track';

const scrobblerEndpoint = 'https://5ryd0tcand.execute-api.us-east-1.amazonaws.com/production/post-lastfm-scrobbles';

@Component({
  selector: 'app-single-track-form',
  templateUrl: './single-track-form.component.html',
  styleUrls: ['./single-track-form.component.css']
})
export class SingleTrackFormComponent {

  model = new SingleTrack("", "", "", 0);

  submitted = false;

  onSubmit() { this.submitted = true;}

  scrobbleTrack() {
    //console.log("this.submitted before: " + this.submitted);
    console.log("Scrobbling request received");
    this.submitted = true;
    //console.log("this.submitted after: " + this.submitted);

    var scrobble = {
      "artist": this.model.artist,
      "album": this.model.album,
      "tracks":[{"title": this.model.title , "duration": this.model.duration}]
    }
    var response = this.postScrobble(scrobble);

    console.log(response);
  }

  sampleTrack(): SingleTrack {
    const sampleTrack =  new SingleTrack("The Beatles", "The Beatles", "While My Guitar Gently Weeps", 440);
    console.log('My sample song is called ' + sampleTrack.title); // "My hero is called SkyDog"
    return sampleTrack;
  }

  showFormControls(form: any) {
    return form && form.controls.name &&
    form.controls.name.value; // Dr. IQ
  }

  // Ejemplo implementando el metodo POST:
async  postScrobble(data: any) {
  // Opciones por defecto estan marcadas con un *

  console.log(data);

  const response = await fetch(scrobblerEndpoint, {
    method: 'POST', // *GET, POST, PUT, DELETE, etc.
    mode: 'no-cors', // no-cors, *cors, same-origin
    cache: 'no-cache', // *default, no-cache, reload, force-cache, only-if-cached
    credentials: 'same-origin', // include, *same-origin, omit
    headers: {
      'Content-Type': 'application/json'
      // 'Content-Type': 'application/x-www-form-urlencoded',
    },
    redirect: 'follow', // manual, *follow, error
    referrerPolicy: 'no-referrer', // no-referrer, *no-referrer-when-downgrade, origin, origin-when-cross-origin, same-origin, strict-origin, strict-origin-when-cross-origin, unsafe-url
    body: JSON.stringify(data) // body data type must match "Content-Type" header
  });
  return response.json(); // parses JSON response into native JavaScript objects
}
}
